import React from 'react';
import { AiFillStar } from 'react-icons/ai';
import {
  BackgroundWrapper,
  BoldText,
  MyPostWrapper,
  ProfileImg,
  ProfileInfoWrapper,
  ProfileWrapper,
  RowWrapper,
  Text,
  UserId,
} from './MypageStyle';
import Profile from '../../assets/img/profile.jpg';

const Mypage: React.FC = () => {
  return (
    <BackgroundWrapper>
      <ProfileWrapper>
        <ProfileImg src={Profile} />
        <ProfileInfoWrapper>
          <RowWrapper>
            <UserId>char_smine</UserId>
            <AiFillStar size="20" />
          </RowWrapper>
          <RowWrapper>
            <Text>게시물 </Text>
            <BoldText>41</BoldText>
          </RowWrapper>
          <BoldText>차승민</BoldText>
          <br />
          <Text>경력: 2020.10.04~</Text>
        </ProfileInfoWrapper>
      </ProfileWrapper>
      <MyPostWrapper />
    </BackgroundWrapper>
  );
};

export default Mypage;
